/*
Other ui styels less template from the web
// This file has fallback variables. It specifies the variables themes
// must implement.

// Colors

@text-color: #333;
@text-color-subtle: #777;
@text-color-highlight: #111;
@text-color-selected: @text-color-highlight;

@text-color-info: #5293d8;
@text-color-success: #1fe977;
@text-color-warning: #f78a46;
@text-color-error: #c00;

@background-color-info: #0098ff;
@background-color-success: #17ca65;
@background-color-warning: #ff4800;
@background-color-error: #c00;
@background-color-highlight: hsla(0,0%,0%,.1);
@background-color-selected: @background-color-highlight;

@app-background-color: #fff;

@base-background-color: #fff;
@base-border-color: #eee;

@pane-item-background-color: @base-background-color;
@pane-item-border-color: @base-border-color;

@input-background-color: #fff;
@input-border-color: @base-border-color;

@tool-panel-background-color: #f4f4f4;
@tool-panel-border-color: @base-border-color;

@inset-panel-background-color: #eee;
@inset-panel-border-color: @base-border-color;

@panel-heading-background-color: #ddd;
@panel-heading-border-color: transparent;

@overlay-background-color: #f4f4f4;
@overlay-border-color: @base-border-color;

@button-background-color: #ccc;
@button-background-color-hover: lighten(@button-background-color, 5%);
@button-background-color-selected: @button-background-color-hover;
@button-border-color: #aaa;

@tab-bar-background-color: #fff;
@tab-bar-border-color: darken(@tab-background-color-active, 10%);
@tab-background-color: #f4f4f4;
@tab-background-color-active: #fff;
@tab-border-color: @base-border-color;

@tree-view-background-color: @tool-panel-background-color;
@tree-view-border-color: @tool-panel-border-color;

@ui-site-color-1: @background-color-success; // green
@ui-site-color-2: @background-color-info; // blue
@ui-site-color-3: @background-color-warning; // orange
@ui-site-color-4: #db2ff4; // purple
@ui-site-color-5: #f5e11d; // yellow


// Sizes

@font-size: 13px;
@input-font-size: 14px;

@disclosure-arrow-size: 12px;

@component-padding: 10px;
@component-icon-padding: 5px;
@component-icon-size: 16px;
@component-line-height: 25px;
@component-border-radius: 2px;

@tab-height: 30px;

// Other

@font-family: system-ui;
@use-custom-controls: true; // false uses native controls
*/
.github-PrTimeline {
  position: relative;
  border-top: 1px solid #383041;
}
.github-PrTimeline .timeline-item {
  padding: 15px 20px;
  padding-left: 45px;
  border-top: 1px solid #383041;
}
.github-PrTimeline .emoji,
.github-PrTimeline g-emoji {
  margin-right: .25em;
}
.github-PrTimeline .author-avatar {
  width: 20px;
  height: 20px;
  margin-right: 5px;
  border-radius: 2px;
}
.github-PrTimeline .open-commit-detail-button {
  padding: 0;
  background-color: transparent;
  border: none;
}
.github-PrTimeline .open-commit-detail-button:hover,
.github-PrTimeline .open-commit-detail-button:focus {
  color: #f0f0f0;
}
.github-PrTimeline .open-commit-detail-button:active {
  color: #808080;
}
.github-PrTimeline .pre-timeline-item-icon {
  position: absolute;
  margin-left: -25px;
  text-align: center;
  margin-top: 2px;
  color: #504a57;
  border-radius: 20px;
}
.github-PrTimeline .commits .info-row {
  margin-bottom: 10px;
}
.github-PrTimeline .commit {
  display: table-row;
  align-items: center;
  margin-left: 20px;
}
.github-PrTimeline .commit:first-child {
  padding-top: 10px;
}
.github-PrTimeline .commit:only-child {
  padding-top: 0;
  padding-bottom: 0;
  margin-left: -10px;
}
.github-PrTimeline .commit + .issue {
  margin-top: 5px;
}
.github-PrTimeline .commit .commit-author {
  position: absolute;
  display: flex;
}
.github-PrTimeline .commit .author-avatar {
  position: relative;
  margin-right: -16px;
  width: 20px;
  height: 20px;
  border-radius: 2px;
  background-color: #383041;
  box-shadow: 1px 0 #241b2f;
  transition: margin 0.12s cubic-bezier(0.5, 0.1, 0, 1);
}
.github-PrTimeline .commit .author-avatar:nth-child(1) {
  z-index: 3;
}
.github-PrTimeline .commit .author-avatar:nth-child(2) {
  z-index: 2;
  opacity: .7;
}
.github-PrTimeline .commit .author-avatar:nth-child(3) {
  z-index: 1;
  opacity: .4;
}
.github-PrTimeline .commit .author-avatar:nth-child(n+4) {
  display: none;
}
.github-PrTimeline .commit .author-avatar:only-child,
.github-PrTimeline .commit .author-avatar:last-child {
  box-shadow: none;
}
.github-PrTimeline .commit .commit-author:hover .author-avatar {
  display: inline-block;
  margin-right: 1px;
  opacity: 1;
}
.github-PrTimeline .commit .commit-message-headline {
  display: table-cell;
  line-height: 24px;
  padding: 0 3.33333333px;
  padding-left: 30px;
  max-height: 20px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
  max-width: 0;
  width: 100%;
}
.github-PrTimeline .commit .commit-sha {
  display: table-cell;
  text-align: right;
  font-family: monospace;
  padding-left: 5px;
  color: #6494ed;
}
.github-PrTimeline .comment-message-header {
  color: #808080;
}
.github-PrTimeline .comment-message-header a {
  color: inherit;
}
.github-PrTimeline .cross-referenced-events {
  border-spacing: 0 5px;
}
.github-PrTimeline .cross-referenced-events .info-row {
  margin-bottom: 10px;
}
.github-PrTimeline .cross-referenced-event {
  display: table-row;
}
.github-PrTimeline .cross-referenced-event:last-child {
  margin-bottom: 0;
}
.github-PrTimeline .cross-referenced-event-header {
  color: #808080;
}
.github-PrTimeline .cross-referenced-event-label {
  display: table-cell;
  width: 100%;
}
.github-PrTimeline .cross-referenced-event-label-title {
  font-weight: bold;
}
.github-PrTimeline .cross-referenced-event-label-number {
  display: inline;
  margin-left: 5px;
  white-space: nowrap;
  color: #808080;
}
.github-PrTimeline .cross-referenced-event-private {
  display: table-cell;
}
.github-PrTimeline .cross-referenced-event-state {
  display: table-cell;
  text-align: right;
}
.github-PrTimeline .cross-referenced-event-state .badge {
  margin-left: 5px;
}
.github-PrTimeline .sha {
  font-family: monospace;
}
.github-PrTimeline .merged-event {
  display: flex;
  align-items: center;
  font-size: .9em;
  line-height: 1.3;
  color: #808080;
}
.github-PrTimeline .merged-event .username,
.github-PrTimeline .merged-event .merge-ref {
  font-weight: bold;
  color: #f0f0f0;
}
.github-PrTimeline .merged-event ~ .issue {
  border-bottom-style: dashed;
}
.github-PrTimeline .head-ref-force-pushed-event .username {
  font-weight: bold;
  color: #f0f0f0;
}
.github-PrTimeline .head-ref-force-pushed-event .sha {
  font-weight: bold;
}
.github-PrTimeline .issue .info-row {
  margin-bottom: 6.66666667px;
}
.github-PrTimeline .issue .github-DotComMarkdownHtml pre > code {
  white-space: pre;
}
.github-PrTimeline-loadMore {
  margin: 20px auto 0;
  text-align: center;
}
